INSERT INTO dog VALUES ('Black Mouth Cur', 'Working Dogs', '16 to 25 inches', '40 to 95 pounds', '12 to 18 years', 'https://www.dogtime.com/assets/uploads/2017/11/black-mouth-cur-dog-breed-pictures-cover-460x260.jpg', 'https://dogtime.com/dog-breeds/black-mouth-cur', 'Energetic, fearless, and strong, the Black Mouth Cur is valued as an all-around working dog bred to help farmers and hunters in the rugged terrain of the southeastern United States.', '{"Height": "16 to 25 inches", "Weight": "40 to 95 pounds", "Life Span": "12 to 18 years", "Dog Breed Group": "Working Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
INSERT INTO dog VALUES ('Black Russian Terrier', 'Working Dogs', '26 to 28 inches at the shoulder', '80 to 140 pounds', '10 to 11 years', 'https://www.dogtime.com/assets/uploads/2011/01/file_22914_black-russian-terrier-460x290.jpg', 'https://dogtime.com/dog-breeds/black-russian-terrier', 'These majestic black beauties are highly intelligent, confident guard dogs who aren’t actually true terriers. Relatively new and still a rare dog breed, the Black Russian Terrier is a working dog who can protect a home or business, play with the family’s children, and excel in agility and obedience competition.', '{"Height": "26 to 28 inches at the shoulder", "Weight": "80 to 140 pounds", "Life Span": "10 to 11 years", "Dog Breed Group": "Working Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
INSERT INTO dog VALUES ('Bloodhound', 'Hound Dogs', '23 to 27 inches ttall at the shoulder', '80 to 110 pounds', '11 to 15 years', 'https://www.dogtime.com/assets/uploads/2011/01/file_23016_bloodhound-460x290.jpg', 'https://dogtime.com/dog-breeds/bloodhound', 'The Bloodhound’s ancestors were created in medieval France to trail deer and boar. Today, this is a highly active and intelligent dog breed whose keen sense of smell has found them a special place in law enforcement and search and rescue. Their fans love them for their sweet nature and unique appearance.', '{"Height": "23 to 27 inches ttall at the shoulder", "Weight": "80 to 110 pounds", "Life Span": "11 to 15 years", "Dog Breed Group": "Hound Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
INSERT INTO dog VALUES ('Blue Lacy', 'Working Dogs', '17 to 25 inches', '25 to 50 pounds', '12 to 16 years', 'https://www.dogtime.com/assets/uploads/2018/04/blue-lacy-dog-breed-pictures-header-460x260.jpg', 'https://dogtime.com/dog-breeds/blue-lacy', 'The Blue Lacy, also called the Lacy Dog, is an energetic, intelligent, and trainable breed that loves having a job to do and a lot of open space to run around.', '{"Height": "17 to 25 inches", "Weight": "25 to 50 pounds", "Life Span": "12 to 16 years", "Dog Breed Group": "Working Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
INSERT INTO dog VALUES ('Bluetick Coonhound', 'Hound Dogs', '23 to 30 inches tall at the shoulder', '45 to 100 pounds', '10 to 12 years', 'https://www.dogtime.com/assets/uploads/2011/01/file_23238_bluetick-coonhound-460x290.jpg', 'https://dogtime.com/dog-breeds/bluetick-coonhound', 'Fast and muscular, the Bluetick Coonhound dog breed stands out for their striking coat. They have a pleasantly pleading expression and a big bawl mouth — meaning they have a long, drawn out bark. Although they’re a hunter first and foremost, the Bluetick can be a fine housedog and loves their people.', '{"Height": "23 to 30 inches tall at the shoulder", "Weight": "45 to 100 pounds", "Life Span": "10 to 12 years", "Dog Breed Group": "Hound Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
INSERT INTO dog VALUES ('Bocker', 'Mixed Breed Dogs', '12 to 15 inches ', '20 to 30 pounds ', '12 to 15 years ', 'https://www.dogtime.com/assets/uploads/2019/09/bocker-mixed-dog-breed-pictures-cover.jpg', 'https://dogtime.com/dog-breeds/bocker', 'The Bocker is a mixed breed dog — a cross between the Cocker Spaniel and Beagle dog breeds. Small, affectionate, and curious by nature, these pups inherited some of the best qualities from both of their parents.', '{"Height": "12 to 15 inches ", "Weight": "20 to 30 pounds ", "Life Span": "12 to 15 years ", "Dog Breed Group": "Mixed Breed Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
INSERT INTO dog VALUES ('Boerboel', 'Working Dogs', '22 to 28 inches', '110 to 200 pounds', '10 to 12 years', 'https://www.dogtime.com/assets/uploads/2018/01/boerboel-dog-breed-pictures-cover-460x260.jpg', 'https://dogtime.com/dog-breeds/boerboel', 'At first glance, you might think the large, intimidating Boerboel would make an excellent guard dog, and you’d be correct. However, this breed is equally known for being loving, calm, and family-friendly, especially towards human children.', '{"Height": "22 to 28 inches", "Weight": "110 to 200 pounds", "Life Span": "10 to 12 years", "Dog Breed Group": "Working Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
INSERT INTO dog VALUES ('Boglen Terrier', 'Mixed Breed Dogs', '12 to 17 inches ', '10 to 40 pounds', '10 to 15 years ', 'https://www.dogtime.com/assets/uploads/2019/09/boglen-terrier-mixed-dog-breed-pictures-cover.jpg', 'https://dogtime.com/dog-breeds/boglen-terrier', 'The Boglen Terrier is a mixed breed dog — a cross between the Beagle and Boston Terrier dog breeds. These dogs are known to be playful, spunky, loyal, <span style="font-weight: 400;">and often times, stubborn. This lovable and perky mix has proven to become quite popular among owners from various backgrounds. </span>', '{"Height": "12 to 17 inches ", "Weight": "10 to 40 pounds", "Life Span": "10 to 15 years ", "Dog Breed Group": "Mixed Breed Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
INSERT INTO dog VALUES ('Bohemian Shepherd', 'Herding Dogs', '19 to 22 inches', '35 to 60 pounds', '10 to 15 years', 'https://www.dogtime.com/assets/uploads/2020/04/Bohemian-Shepherd-dog-breed-pictures-cover.jpg', 'https://dogtime.com/dog-breeds/bohemian-shepherd', 'The Bohemian Shepherd dog breed originated in the Czech Republic around the 1300s in the Chodsko region, hence why these dogs were commonly called the Chodský pes. They were first used as guard dogs and as herding dogs. Today, they make great family pets who will protect and watch over their humans.', '{"Height": "19 to 22 inches", "Weight": "35 to 60 pounds", "Life Span": "10 to 15 years", "Dog Breed Group": "Herding Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
INSERT INTO dog VALUES ('Bolognese', 'Companion Dogs', '9 to 12 inches tall at the shoulder', '8 to 14 pounds', '12 to 14 years', 'https://www.dogtime.com/assets/uploads/2011/01/file_23240_bolognese-460x290.jpg', 'https://dogtime.com/dog-breeds/bolognese', 'A true companion dog, the Bolognese dog breed loves to be at their family’s side. However, they also loves getting their way and can be quite crafty about it, so be careful — you could find yourself being manipulated by a ten-pound furball.', '{"Height": "9 to 12 inches tall at the shoulder", "Weight": "8 to 14 pounds", "Life Span": "12 to 14 years", "Dog Breed Group": "Companion Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
INSERT INTO dog VALUES ('Borador', 'Hybrid Dogs', '19 to 24 inches', '40 to 65 pounds', '10 to 15 years', 'https://www.dogtime.com/assets/uploads/2019/09/borador-mixed-dog-breed-pictures-cover.jpg', 'https://dogtime.com/dog-breeds/borador', 'The Borador is a mixed breed dog — a cross between the Border Collie and Labrador Retriever dog breeds. Outgoing, curious, and energetic, these pups inherited some of the best qualities from both of their parents.', '{"Height": "19 to 24 inches", "Weight": "40 to 65 pounds", "Life Span": "10 to 15 years", "Dog Breed Group": "Hybrid Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
INSERT INTO dog VALUES ('Border Collie', 'Herding Dogs', '18 to 22 inches tall at the shoulder', '30 to 45 pounds', '12 to 15 years', 'https://www.dogtime.com/assets/uploads/2011/01/file_23178_border-collie-460x290.jpg', 'https://dogtime.com/dog-breeds/border-collie', 'The Border Collie dog breed was developed to gather and control sheep in the hilly border country between Scotland and England. They’re known for their intense stare, or “eye,” with which they control their flock. They’re dogs with unlimited energy, stamina, and working drive, all of which make them a premier herding dog; Border Collies are still used today to herd sheep on farms and ranches around the world.', '{"Height": "18 to 22 inches tall at the shoulder", "Weight": "30 to 45 pounds", "Life Span": "12 to 15 years", "Dog Breed Group": "Herding Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
