INSERT INTO dog VALUES ('Chow Chow', 'Working Dogs', '17 to 20 inches tall at the shoulder', '40 to 70 pounds', '12 to 15 years', 'https://www.dogtime.com/assets/uploads/2011/01/file_23144_chow-chow-460x290.jpg', 'https://dogtime.com/dog-breeds/chow-chow', 'The distinctive-looking Chow Chow dog breed has a proud, independent spirit that some describe as catlike. They can be aloof — if you’re looking for a cuddle buddy, this probably isn’t the best breed for you — and downright suspicious of strangers. But for the right person, they can be a fiercely loyal companion.', '{"Height": "17 to 20 inches tall at the shoulder", "Weight": "40 to 70 pounds", "Life Span": "12 to 15 years", "Dog Breed Group": "Working Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
INSERT INTO dog VALUES ('Chow Shepherd', 'Mixed Breed Dogs', '22 to 26 inches', '45 to 90 pounds ', '12 to 15 years ', 'https://www.dogtime.com/assets/uploads/2020/01/chow-shepherd-mixed-dog-breed-pictures-cover.jpg', 'https://dogtime.com/dog-breeds/chow-shepherd', 'The Chow Shepherd is a mixed breed dog–a cross between the Chow Chow and German Shepherd dog breeds. Medium to large in size, protective, and playful, these pups inherited some of the best traits from both of their parents.', '{"Height": "22 to 26 inches", "Weight": "45 to 90 pounds ", "Life Span": "12 to 15 years ", "Dog Breed Group": "Mixed Breed Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
