INSERT INTO dog VALUES ('Cockapoo', 'Hybrid Dogs', 'From under 10 to over 15 inches tall at the shoulder', 'From under 6 to over 19 pounds', '12 to 15 years', 'https://www.dogtime.com/assets/uploads/2011/01/file_23218_cockapoo-dog-breed.jpg', 'https://dogtime.com/dog-breeds/cockapoo', 'An adorable, small dog with the personality of a big clown, the Cockapoo is perhaps the first of the “designer dogs” (not a purebred dog breed), dating back to the 1960s, rather than to just a few years ago.', '{"Height": "From under 10 to over 15 inches tall at the shoulder", "Weight": "From under 6 to over 19 pounds", "Life Span": "12 to 15 years", "Dog Breed Group": "Hybrid Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
INSERT INTO dog VALUES ('Cocker Spaniel', 'Sporting Dogs', '1 foot, 2 inches to 1 foot, 3 inches tall at the shoulder', '24 to 28 pounds', '12 to 15 years', 'https://www.dogtime.com/assets/uploads/2011/01/file_22962_cocker-spaniel-460x290.jpg', 'https://dogtime.com/dog-breeds/cocker-spaniel', 'The Cocker Spaniel is primarily a beloved companion dog breed, though they remain a capable bird dog at heart. Beautiful to look at–and labor-intensive to groom–the Cocker’s amenable, cheerful disposition also makes them a treat to have in the family.', '{"Height": "1 foot, 2 inches to 1 foot, 3 inches tall at the shoulder", "Weight": "24 to 28 pounds", "Life Span": "12 to 15 years", "Dog Breed Group": "Sporting Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
INSERT INTO dog VALUES ('Collie', 'Herding Dogs', '22 to 26 inches all at the shoulder', '50 to 70 pounds', '10 to 14 years', 'https://www.dogtime.com/assets/uploads/2011/01/file_23186_collie-460x290.jpg', 'https://dogtime.com/dog-breeds/collie', 'The Collie dog breed is a native of Scotland, mostly of the Highland regions but also bred in the Scottish Lowlands and northern England, where they were used primarily as a herding dog. They’re great family companions and are still capable herding dogs.', '{"Height": "22 to 26 inches all at the shoulder", "Weight": "50 to 70 pounds", "Life Span": "10 to 14 years", "Dog Breed Group": "Herding Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
