INSERT INTO dog VALUES ('Glen of Imaal Terrier', 'Terrier Dogs', '12 to 14 inches tall at the shoulder', 'Up to 35 pounds', '12 to 15 years', 'https://www.dogtime.com/assets/uploads/2011/01/file_23066_glen-of-imaal-terrier-460x290.jpg', 'https://dogtime.com/dog-breeds/glen-of-imaal-terrier', 'The Glen of Imaal Terrier is a strong, independent dog breed named for the remote valley in Ireland where they originated. Bred to hunt fox and badger, and to keep homes free of rodents, the Glen is a skilled and cunning hunter. They’re also an affectionate family dog, gentle, and loving with their people.', '{"Height": "12 to 14 inches tall at the shoulder", "Weight": "Up to 35 pounds", "Life Span": "12 to 15 years", "Dog Breed Group": "Terrier Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
