INSERT INTO dog VALUES ('Goldendoodle', 'Hybrid Dogs', '20 to 24 inches tall at the shoulder', '50 to 90 pounds', '10 to 15 years', 'https://www.dogtime.com/assets/uploads/2011/01/file_23204_goldendoodle-460x290.jpg', 'https://dogtime.com/dog-breeds/goldendoodle', 'The Goldendoodle is a “designer dog,” a hybrid dog breed resulting from mixing the Poodle with the Golden Retriever. Like all other designer “breeds,” this Doodle is not truly a breed of its own, but is a crossbreed — and in this case, a cross that is enjoying growing popularity.', '{"Height": "20 to 24 inches tall at the shoulder", "Weight": "50 to 90 pounds", "Life Span": "10 to 15 years", "Dog Breed Group": "Hybrid Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
