INSERT INTO dog VALUES ('Lhasa Apso', 'Companion Dogs', '9 to 11 inches tall at the shoulder', '12 to 15 pounds', '12 to 15 years', 'https://www.dogtime.com/assets/uploads/2011/01/file_23154_lhasa-apso-460x290.jpg', 'https://dogtime.com/dog-breeds/lhasa-apso', 'The Lhasa Apso dog breed is originally from Tibet, where they were highly regarded watchdogs in the palaces and monasteries of their mountainous homeland. Today’s Lhasa is no longer a palace guard but primarily a family companion who loyally protects their family from danger.', '{"Height": "9 to 11 inches tall at the shoulder", "Weight": "12 to 15 pounds", "Life Span": "12 to 15 years", "Dog Breed Group": "Companion Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
