INSERT INTO dog VALUES ('Saluki', 'Hound Dogs', '23 to 28 inches tall at the shoulder', '35 to 70 pounds', '12 to 14 years', 'https://www.dogtime.com/assets/uploads/2011/01/file_23044_saluki-460x290.jpg', 'https://dogtime.com/dog-breeds/saluki', 'One of the oldest of dog breeds, Salukis were once considered a gift from Allah. They’re fast as the wind, skinny as a supermodel, and quietly devoted to their people.', '{"Height": "23 to 28 inches tall at the shoulder", "Weight": "35 to 70 pounds", "Life Span": "12 to 14 years", "Dog Breed Group": "Hound Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
INSERT INTO dog VALUES ('Samoyed', 'Working Dogs', '1 foot, 7 inches to 2 feet tall at the shoulder', '50 to 60 pounds', '12 to 14 years', 'https://www.dogtime.com/assets/uploads/2011/01/file_22946_Samoyed-dog-breed.jpg', 'https://dogtime.com/dog-breeds/samoyed', 'Originally bred to hunt, haul sledges, and herd reindeer, the Samoyed dog breed proved a valuable companion for northwestern Siberia’s Samoyede people. Among the breed’s duties: pack hiking, tracking, and warming their owners by sleeping on top of them at night.', '{"Height": "1 foot, 7 inches to 2 feet tall at the shoulder", "Weight": "50 to 60 pounds", "Life Span": "12 to 14 years", "Dog Breed Group": "Working Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
INSERT INTO dog VALUES ('Samusky', 'Mixed Breed Dogs', '20 to 24 inches', '45 to 60 pounds', '12 to 15 years', 'https://www.dogtime.com/assets/uploads/2019/12/samusky-mixed-dog-breed-pictures-cover.jpg', 'https://dogtime.com/dog-breeds/samusky', 'The Samusky is a mixed breed dog–a cross between the Samoyed and the Siberian Husky dog breeds. Highly intelligent, loyal, and good-natured, these pups inherited some of the best qualities from both of their parents.', '{"Height": "20 to 24 inches", "Weight": "45 to 60 pounds", "Life Span": "12 to 15 years", "Dog Breed Group": "Mixed Breed Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
INSERT INTO dog VALUES ('Schipperke', 'Companion Dogs', '10 to 15 inches tall at the shoulder', '11 to 18 pounds', '13 to 15 years', 'https://www.dogtime.com/assets/uploads/2011/01/file_23158_schipperke-460x290.jpg', 'https://dogtime.com/dog-breeds/schipperke', 'Curious and clever, the Schipperke dog breed is often nicknamed LBD, for little black devil. They’re fearless and devoted, always on guard to protect their family from harm.', '{"Height": "10 to 15 inches tall at the shoulder", "Weight": "11 to 18 pounds", "Life Span": "13 to 15 years", "Dog Breed Group": "Companion Dogs"}', '{"Adaptability": {"value": 3, "children": {"Sensitivity Level": 5, "Tolerates Being Alone": 2, "Tolerates Hot Weather": 4, "Good For Novice Owners": 2, "Tolerates Cold Weather": 4, "Adapts Well To Apartment Living": 1}}, "Trainability": {"value": 5, "children": {"Prey Drive": 5, "Intelligence": 4, "Easy To Train": 5, "Wanderlust Potential": 5, "Potential For Mouthiness": 3, "Tendency To Bark Or Howl": 5}}, "Physical Needs": {"value": 5, "children": {"Intensity": 5, "Energy Level": 5, "Exercise Needs": 5, "Potential For Playfulness": 5}}, "All Around Friendliness": {"value": 5, "children": {"Dog Friendly": 4, "Kid-Friendly": 5, "Affectionate With Family": 5, "Friendly Toward Strangers": 5}}, "Health And Grooming Needs": {"value": 3, "children": {"Size": 3, "Easy To Groom": 5, "General Health": 4, "Amount Of Shedding": 3, "Drooling Potential": 1, "Potential For Weight Gain": 3}}}');
